import redis

from parm import redis_host, redis_db, redis_port, redis_passwd


class RedisConnect:
    def __init__(self):
        self.conn = redis.Redis(host=redis_host,port=redis_port,password=redis_passwd,db=redis_db,decode_responses=True, charset='UTF-8', encoding='UTF-8')

    def save_k_v(self, k, v):
        self.conn.set(k, v)

    def get_data(self, k):
        res = self.conn.get(k)
        return res

    def update(self,k, v):
        res = self.conn.getset(k, v)
        return res

    def get_all(self):
        res = self.conn.keys("*")
        return res

